import React from 'react';
import { useOutletContext } from 'react-router-dom';

function Home() {
  const pull = useOutletContext();

  // Check if data is present and not an empty array
  const name = pull.data && pull.data.length > 0 ? pull.data[0].firstname : '';

  return (
    <>
      {name}
      <small className="bottom" id="glass">
        Home
      </small>
    </>
  );
}

export default Home;
